function fetchData(){fetch("https://tedxsac.up.railway.app/display").then((t=>t.json())).then((t=>{var n=document.querySelector("tbody");n.innerHTML="",t.forEach(((t,d)=>{var e=document.createElement("tr");e.innerHTML=`\n                        <td>${d+1}</td>\n                        <td>${t[0]}</td>\n                        <td>${t[1]}</td>\n                        <td>${t[2]}</td>\n                        <td>${t[3]?"Internal":"External"}</td>\n                        <td>${t[4]}</td>\n                        <td>${t[5]}</td>\n                    `,n.appendChild(e)}))})).catch((t=>{console.error("Error fetching data:",t)}))}window.onload=fetchData;
